function App() {
const dispatch = useDispatch()

useEffect(() => {
dispatch(getCategories())
},[dispatch])

  return (
    <div className="app">
      <Header/>
    <div className="container">
    <Sidebar/>
    <AppRoutes/>

    </div>
    <Footer/>
    </div>
  );
}

export default App;
